const approveDoctor = async (doctorId) => {
  try {
    let result = await db.User.update(
      { status: "APPROVED" },
      { where: { id: doctorId, roleId: "R2" } } // ch p dng cho bc s
    );

    if (result[0] === 0) {
      return { errCode: 1, errMessage: "Doctor not found or not eligible" };
    }

    return { errCode: 0, errMessage: "Doctor approved successfully" };
  } catch (e) {
    console.log("approveDoctor service error:", e);
    return { errCode: -1, errMessage: "Server error" };
  }
};

const rejectDoctor = async (doctorId) => {
  try {
    let result = await db.User.update(
      { status: "REJECTED" },
      { where: { id: doctorId } }
    );
    if (result[0] === 0) {
      return { errCode: 1, errMessage: "Doctor not found" };
    }

    return { errCode: 0, errMessage: "Doctor rejected successfully" };
  } catch (e) {
    console.log("rejectDoctorService error:", e);
    return { errCode: -1, errMessage: "Server error" };
  }
};

let sendInterviewEmail = async (data) => {
  try {
    const { doctorId, date, time, method, contact } = data;

    //  1. Ly thng tin bc s t DB
    let doctor = await db.User.findOne({
      where: { id: doctorId },
      raw: true,
    });

    if (!doctor) {
      return { errCode: 1, errMessage: "Khng tm thy bc s" };
    }

    //  2. nh dng li ngy & gi
    // Chuyn '2025-10-09'  '09/10/2025'
    const formattedDate = new Date(date).toLocaleDateString("vi-VN", {
      day: "2-digit",
      month: "2-digit",
      year: "numeric",
    });

    // m bo gi hin th ng 24h (nu ngi dng chn input type="time" th mc nh l 24h)
    // Nhng ta vn m bo format chun HH:mm
    const [hours, minutes] = time.split(":");
    const formattedTime = `${hours.padStart(2, "0")}:${minutes.padStart(
      2,
      "0"
    )}`;

    //  3. Chun b d liu gi sang emailService
    let dataSend = {
      email: doctor.email,
      doctorName: `${doctor.lastName} ${doctor.firstName}`,
      date: formattedDate,
      time: formattedTime,
      method,
      contact,
    };

    //  4. Gi email
    await emailService.sendInterviewEmail(dataSend);

    return { errCode: 0, message: "Email phng vn  c gi!" };
  } catch (e) {
    console.log("sendInterviewEmail error:", e);
    return { errCode: -1, errMessage: "Li server khi gi email" };
  }
};

