sourcesContent:
require("dotenv").config();
import nodemailer from "nodemailer";

let sendSimpleEmail = async (dataSend) => {
  let transporter = nodemailer.createTransport({
    host: "smtp.gmail.com",
    port: 587, //587 for false
    secure: false, // true for 465, false for other ports
    auth: {
      user: process.env.EMAIL_APP,
      pass: process.env.EMAIL_APP_PASSWORD,
    },
  });

  let info = await transporter.sendMail({
    from: '"FurCare" <Furcareee@gmail.com>',
    to: dataSend.reciverEmail,
    subject: "Xc nhn t lch khm th cng t FurCare",
    text: "FurCare - Xc nhn lch khm", // plain-text body
    html: getBodyHTMLEmail(dataSend),
  });
};

let getBodyHTMLEmail = (dataSend) => {
  let result = "";
  if (dataSend.language === "vi") {
    result = `
    <div style="font-family: Arial, sans-serif; padding: 20px;">
      <h3>Xin cho ${dataSend.patientName},</h3>
      <p>FurCare xin xc nhn rng bn  <strong>t lch khm thnh cng</strong> cho th cng ca mnh.</p>
      
      <h4> Thng tin lch hn:</h4>
      <ul>
        <li><strong>Bc s:</strong> ${dataSend.doctorName}</li>
        <li><strong>Th cng:</strong> ${dataSend.petName}</li>
        <li><strong>Thi gian:</strong> ${dataSend.time}</li>
      </ul>

      <p> Vui lng c mt ng gi v mang theo s khm hoc thng tin lin quan nu c.</p>
        <div>
        <a href=${dataSend.redirectLink} target="_blank">Click here</a>
        <p style="margin-top: 30px;">Trn trng,<br/>
         i ng FurCare </p>
        </div>
      <hr/>
      <small>Email ny c gi t ng t h thng. Vui lng khng tr li email ny.</small>
    </div>
  `;
  }
  if (dataSend.language === "en") {
    result = `
    <div style="font-family: Arial, sans-serif; padding: 20px;">
      <h3>Hello ${dataSend.patientName},</h3>

      <p>Were happy to confirm your <strong>pet's appointment</strong> has been successfully scheduled via <strong>FurCare</strong>.</p>

      <h4> Appointment Details:</h4>
      <ul>
      <li><strong>Doctor:</strong> ${dataSend.doctorName}</li>
      <li><strong>Pet Name:</strong> ${dataSend.petName}</li>
        <li><strong>Time:</strong> ${dataSend.time}</li>
      </ul>

      <p> Please make sure to arrive on time and bring any relevant medical history or documents if available.</p>

      <p>If you need to modify or cancel your appointment, feel free to contact us via email or hotline.</p>

      <div>
      <a href=${dataSend.redirectLink} target="_blank">Click here</a>
      <p style="margin-top: 30px;">Best regards,<br/>
      The FurCare Team </p>
        </div>

      <hr/>
      <small>This is an automated message. Please do not reply to this email.</small>
    </div>
  `;
  }

  return result;
};

let getBodyHTMLEmailRemedy = (dataSend) => {
  let result = "";

  if (dataSend.language === "vi") {
    result = `
    <div style="font-family: Arial, sans-serif; padding: 20px;">
      <h3>Xin cho ${dataSend.patientName},</h3>

      <p> FurCare xc nhn rng bn  <strong>thanh ton thnh cng ha n khm bnh</strong> cho th cng ca mnh.</p>

      <p> Thng tin chi tit ha n  c gi km di dng <strong>hnh nh nh km</strong> trong email ny.</p>

      <p style="margin-top: 30px;">Cm n bn  tin tng s dng dch v ca FurCare.<br/>
      Trn trng,<br/>
      i ng FurCare </p>

      <hr/>
      <small>Email ny c gi t ng t h thng. Vui lng khng tr li email ny.</small>
    </div>
  `;
  }

  if (dataSend.language === "en") {
    result = `
    <div style="font-family: Arial, sans-serif; padding: 20px;">
      <h3>Hello ${dataSend.patientName},</h3>

      <p> FurCare confirms that your <strong>payment for the veterinary invoice</strong> has been successfully received.</p>

      <p> The full invoice details are included as a <strong>picture attachment</strong> with this email.</p>

      <p style="margin-top: 30px;">Thank you for trusting FurCare.<br/>
      Best regards,<br/>
      The FurCare Team </p>

      <hr/>
      <small>This is an automated message. Please do not reply to this email.</small>
    </div>
  `;
  }

  return result;
};

let sendAttachment = async (dataSend) => {
  return new Promise(async (resolve, reject) => {
    try {
      let transporter = nodemailer.createTransport({
        host: "smtp.gmail.com",
        port: 587, //587 for false
        secure: false, // true for 465, false for other ports
        auth: {
          user: process.env.EMAIL_APP,
          pass: process.env.EMAIL_APP_PASSWORD,
        },
      });

      let info = await transporter.sendMail({
        from: '"FurCare" <Furcare@gmail.com>',
        to: dataSend.email,
        subject: "Ha n khm bnh t FurCare",
        text: "FurCare - Ha n khm bnh", // plain-text body
        html: getBodyHTMLEmailRemedy(dataSend),
        attachments: [
          {
            filename: `remedy-${
              dataSend.patientID
            }-${new Date().getTime()}.pdf`,
            content: dataSend.imgBase64.split("base64,")[1],
            encoding: "base64",
          },
        ],
      });

      resolve(true);
    } catch (e) {
      reject(e);
    }
  });
};

let sendInterviewEmail = async (dataSend) => {
  let transporter = nodemailer.createTransport({
    host: "smtp.gmail.com",
    port: 587,
    secure: false,
    auth: {
      user: process.env.EMAIL_APP,
      pass: process.env.EMAIL_APP_PASSWORD,
    },
  });

  // to template HTML
  let htmlContent = `
    <div style="font-family: Arial, sans-serif; padding: 20px;">
      <h2> Xin cho ${dataSend.doctorName},</h2>

      <p>Chc mng bn  vt qua vng xt duyt h s bc s ti <strong>FurCare</strong>.</p>
      <p>Chng ti trn trng mi bn tham gia <strong>bui phng vn</strong>  hon tt quy trnh tuyn chn.</p>

      <h4> Thng tin bui phng vn:</h4>
      <ul>
        <li><strong>Ngy:</strong> ${dataSend.date}</li>
        <li><strong>Thi gian:</strong> ${dataSend.time}</li>
        <li><strong>Hnh thc:</strong> ${dataSend.method}</li>
        <li><strong>Lin h:</strong> ${
          dataSend.contact || "support@furcare.com"
        }</li>
      </ul>

      <p>Vui lng phn hi email ny  xc nhn lch phng vn hoc lin h trc tip vi chng ti nu bn cn i lch.</p>

      <p style="margin-top: 20px;">Trn trng,<br/>i ng FurCare </p>
      <hr/>
      <small>Email ny c gi t ng. Vui lng khng tr li trc tip.</small>
    </div>
  `;

  await transporter.sendMail({
    from: '"FurCare" <FurCareee@gmail.com>',
    to: dataSend.email,
    subject: "Th mi phng vn t FurCare",
    html: htmlContent,
  });
};

let sendCancelEmail = async (dataSend) => {
  let transporter = nodemailer.createTransport({
    host: "smtp.gmail.com",
    port: 587,
    secure: false,
    auth: {
      user: process.env.EMAIL_APP,
      pass: process.env.EMAIL_APP_PASSWORD,
    },
  });

  let info = await transporter.sendMail({
    from: '"FurCare" <Furcareee@gmail.com>',
    to: dataSend.reciverEmail,
    subject: "Thng bo thay i lch khm t FurCare",
    html: getCancelHTMLEmail(dataSend),
  });
};

let getCancelHTMLEmail = (dataSend) => {
  return `
  <div style="font-family: Arial, sans-serif; padding: 20px;">
    <h3>Xin cho ${dataSend.patientName},</h3>
    <p>Rt tic, bc s <strong>${dataSend.doctorName}</strong> hin ang kt lch t xut nn khng th nhn lch khm ca bn vo thi gian:</p>
    
    <ul>
      <li><strong>Th cng:</strong> ${dataSend.petName}</li>
      <li><strong>Thi gian:</strong> ${dataSend.time}</li>
    </ul>

    <p>Chng ti  hy lch hn ny. Bn c th t li vo thi gian khc ph hp hn.</p>

    <p>Chng ti thnh tht xin li v s bt tin ny.</p>

    <p style="margin-top: 30px;">Trn trng,<br/>i ng FurCare </p>

    <hr/>
    <small>Email ny c gi t ng t h thng. Vui lng khng tr li email ny.</small>
  </div>
  `;
};

module.exports = {
  sendSimpleEmail: sendSimpleEmail,
  sendAttachment: sendAttachment,
  sendInterviewEmail,
  sendCancelEmail,
};

