import aiService from "../services/aiService.js";

// const handleAskAI = async (req, res) => {
//   try {
//     const { question } = req.body;

//     // Kim tra input
//     if (!question || question.trim() === "") {
//       return res.status(400).json({
//         errCode: 1,
//         message: "Thiu ni dung cu hi.",
//       });
//     }

//     // Gi service x l logic AI
//     const response = await aiService.handleAskAI(question);

//     return res.status(200).json({
//       errCode: 0,
//       message: "OK",
//       data: response,
//     });
//   } catch (error) {
//     console.error(" Li ti AI Controller:", error);
//     return res.status(500).json({
//       errCode: -1,
//       message: "Li server ni b khi x l cu hi AI.",
//       error: error.message,
//     });
//   }
// };

const handleAskAI = async (req, res) => {
  try {
    const { question } = req.body;

    if (!question || question.trim() === "") {
      return res.status(400).json({ errCode: 1, message: "Thiu cu hi" });
    }

    // Bt ch  stream v FE
    res.setHeader("Content-Type", "text/plain; charset=utf-8");
    res.setHeader("Transfer-Encoding", "chunked");

    // Gi service stream tng chunk v FE
    await aiService.handleAskAI(question, res);
  } catch (error) {
    console.log(" AI Controller ERROR:", error);
    return res.status(500).json({
      errCode: -1,
      message: "Li x l AI",
      error: error.message,
    });
  }
};

export default {
  handleAskAI,
};

