import db from "../models/index.js";
import axios from "axios";

const aiService = {
  handleAskAI: async (question, res) => {
    try {
      // ------ To Context RAG t Database ------
      const keywords = ["bc s", "chuyn khoa", "khm", "th y"];
      const isDoctor = keywords.some((kw) =>
        question.toLowerCase().includes(kw)
      );
      let extraContext = "";

      if (isDoctor) {
        const specialties = await db.Specialty.findAll({
          attributes: ["id", "name"],
          raw: true,
        });

        const match = specialties.find((s) =>
          question.toLowerCase().includes(s.name.toLowerCase())
        );

        if (match) {
          const doctors = await db.Doctor_Infor.findAll({
            where: { specialtyID: match.id },
            include: [
              {
                model: db.User,
                as: "doctorInfo",
                attributes: [
                  "firstName",
                  "lastName",
                  "phoneNumber",
                  "address",
                  "gender",
                ],
              },
            ],
            raw: true,
            nest: true,
          });

          extraContext = doctors.length
            ? doctors
                .map(
                  (d) =>
                    `- BS ${d.doctorInfo.lastName} ${
                      d.doctorInfo.firstName}
                     | ${d.doctorInfo.phoneNumber ?? "N/A"} | ${
                      d.doctorInfo.address ?? "N/A"
                    }`
                )
                .join("\n")
            : `Khng c bc s no cho chuyn khoa ${match.name}`;
        }
      }

      //       const prompt = extraContext
      //         ? `
      // Thng tin bc s t database:
      // ${extraContext}

      // Cu hi: ${question}
      // Tr li ting Vit r rng, u tin thng tin trong DB.
      // `
      //         : `Cu hi: ${question}\nTr li ngn gn ting Vit.`;

      const prompt = extraContext
        ? `Bn l AI t vn thng tin bc s th y.
Ch c s dng d liu trong phn "D liu bc s" bn di  tr li.
Tuyt i khng t ba thm tn, s in thoi hay thng tin ngoi d liu.

D liu bc s:
${extraContext}

Yu cu: "${question}"
Tr li bng danh sch gn gng, ng thng tin c trong database.
Nu d liu khng lin quan hoc khng tm thy th hy ni r: "Khng c bc s ph hp trong h thng."`
        : `Bn l AI tr li ngn gn bng ting Vit.
Tr li cu hi: "${question}"
Nu cu hi yu cu d liu bc s m khng c context th yu cu ngi dng cung cp chuyn khoa.`;

      // ------ STREAM t Ollama ------
      const response = await axios({
        url: "http://localhost:11434/api/generate",
        method: "POST",
        responseType: "stream",
        data: {
          model: "phi3:mini", //  m hnh ph hp my bn
          prompt,
          stream: true,
        },
      });

      response.data.on("data", (chunk) => {
        try {
          const text = JSON.parse(chunk.toString()).response;
          if (text) res.write(text); // gi tng on v FE
        } catch {}
      });

      response.data.on("end", () => res.end());
    } catch (err) {
      console.log(" AI Service ERROR:", err.message);
      res.write(" AI ang gp s c, th li sau.");
      res.end();
    }
  },
};

export default aiService;

