import db from "../models/index";
import { Op } from "sequelize";

let getMedicinesService = async (search) => {
  try {
    let whereCondition = {};

    // Nu c tham s search th lc theo k t u
    if (search) {
      whereCondition = {
        [Op.or]: [
          { "$allcodeData.valueVI$": { [Op.like]: `%${search}%` } },
          { "$allcodeData.valueEN$": { [Op.like]: `%${search}%` } },
        ],
      };
    }

    let medicines = await db.Medicine.findAll({
      where: whereCondition,
      include: [
        {
          model: db.Allcode,
          as: "allcodeData",
          attributes: ["id", "keyMap", "valueVI", "valueEN"],
        },
      ],
      order: [["id", "DESC"]],
      raw: false,
      nest: true,
    });

    return {
      errCode: 0,
      errMessage: "OK",
      data: medicines,
    };
  } catch (e) {
    console.log(e);
    return { errCode: -1, errMessage: "Error from server" };
  }
};

module.exports = {
  getMedicinesService,
};

