sourcesContent:
"use strict";
const { Model } = require("sequelize");

module.exports = (sequelize, DataTypes) => {
  class FinalBill extends Model {
    static associate(models) {
      FinalBill.belongsTo(models.Invoice, {
        foreignKey: "invoiceId",
        targetKey: "id",
        as: "invoiceData",
      });

      FinalBill.belongsTo(models.Booking, {
        foreignKey: "bookingId",
        targetKey: "id",
        as: "bookingData",
      });

      FinalBill.belongsTo(models.User, {
        foreignKey: "userId",
        targetKey: "id",
        as: "userData",
      });
    }
  }

  FinalBill.init(
    {
      userId: DataTypes.INTEGER,
      bookingId: DataTypes.INTEGER,
      invoiceId: DataTypes.INTEGER,

      examinationFee: DataTypes.FLOAT, // ph khm ca bc s
      medicineFee: DataTypes.FLOAT, // tng t InvoiceItems
      depositAmount: DataTypes.FLOAT, // tin  thanh ton trc (nu c)
      finalAmount: DataTypes.FLOAT, // tng cui cng phi tr
      remainingAmount: DataTypes.FLOAT, // tin khch phi tr tip
      status: {
        type: DataTypes.STRING, // pending | paid
        defaultValue: "pending",
      },
    },
    { sequelize, modelName: "FinalBill" }
  );

  return FinalBill;
};

